import { BrowserRouter, Routes, Route, Link, Outlet } from 'react-router-dom';

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="users" element={<Users />}>
                    <Route path="me" element={<OwnUserProfile />} />
                    <Route path=":id" element={<UserProfile />} />
                </Route>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
